import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";
import { FaStar } from "react-icons/fa"; // Example icon; you can use any other

const StyledNavbar = styled.nav`
  background-color: #fbf9f7;
  color: black;
  position: sticky;
  top: 0;
  z-index: 3;
  width: 100%;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

const Container = styled.div`
  height: 60px;
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 0 20px;
`;

const Wrapper = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  width: 100%;
  max-width: 1200px;
`;

const Logo = styled.h1`
  font-weight: bold;
  font-size: 24px;
  margin: 0;
  text-align: center;
  color: #333;
  flex: 1;
`;

const MenuItem = styled.div`
  font-size: 15px;
  cursor: pointer;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const StyledLink = styled(Link)`
  color: inherit;
  text-decoration: none;
`;

const FavoritesIcon = styled(FaStar)`
  font-size: 20px;
  color: #333;
  cursor: pointer;

  &:hover {
    color: #ffcc00;
  }
`;

const Navbar = () => {
  return (
    <StyledNavbar>
      <Container>
        <Wrapper>
          <MenuItem>
            <StyledLink to="/favorites">
              <FavoritesIcon />
            </StyledLink>
          </MenuItem>
          <Logo>RECIPE TAKER</Logo>
          <div />
        </Wrapper>
      </Container>
    </StyledNavbar>
  );
};

export default Navbar;
